import React, { useState, useEffect } from 'react';
import 'bootstrap/dist/css/bootstrap.min.css';
import { useNavigate } from 'react-router-dom';
import { ajax_or_login } from '../../ajax';
import './style.css';
import Reservation from '../../components/Reservations';
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome';
import { faPlus, faGlobeAsia, faTag } from '@fortawesome/free-solid-svg-icons';


function ReservationsPage() {
  return (
    <div>
      <Header />
      <MainContent />
      <Footer />
    </div>
  );
}

function Header() {
  return <div className="header"></div>;
}

function MainContent(){
    const navigate = useNavigate();
    const [ reservationsclient, setReservationsclient ] = useState([]);
    const [ reservationshost, setReservationshost ] = useState([]);//然后在底下分为两种

    useEffect(() => {
        ajax_or_login("/reservations/client/all/", {}, navigate)
        .then(response => response.json())
        .then(json => setReservationsclient(json))
    }, [navigate]);

    useEffect(() => {
        ajax_or_login("/reservations/client/all/", {}, navigate)
        .then(response => response.json())
        .then(json => setReservationshost(json))
    }, [navigate]);

    return (
            <div className="container py-5">
              <div className="d-flex justify-content-between">
                <h1>My Properties & Orders</h1>
                <div>
                  <p>Create New Properties!</p>
                  <div className="d-flex justify-content-center">
                    <a href="CreateProperty.html">
                      <button type="button" className="btn btn-warning btn-lg btn-floating">
                        <FontAwesomeIcon icon={faPlus} />
                      </button>
                    </a>
                  </div>
                </div>
              </div>
              <ul className="nav nav-tabs mb-3" id="myTab0" role="tablist">
                <li className="nav-item" role="presentation">
                  <button
                    className="nav-link active"
                    id="home-tab0"
                    data-mdb-toggle="tab"
                    data-mdb-target="#home0"
                    type="button"
                    role="tab"
                    aria-controls="home"
                    aria-selected="true"
                  >
                    User Reservations
                  </button>
                </li>
                <li className="nav-item" role="presentation">
                  <button
                    className="nav-link"
                    id="profile-tab0"
                    data-mdb-toggle="tab"
                    data-mdb-target="#profile0"
                    type="button"
                    role="tab"
                    aria-controls="profile"
                    aria-selected="false"
                  >
                    Host Reservations
                  </button>
                </li>
              </ul>
              <div className="tab-content" id="myTabContent0">
                <PropertiesList />
                <OrdersList />
              </div>
            </div>
          );
        };


function Footer() {
    return (
    <footer className="text-center text-lg-start bg-light text-muted fixed-bottom">
    <div
        className="text-center p-4"
        style={{ backgroundColor: 'rgba(0, 0, 0, 0.05)' }}
        >
        © 2023 Copyright
    </div>
    </footer>
);
}


const PropertiesList = () => {
  return (
    <div
      className="tab-pane fade show active"
      id="home0"
      role="tabpanel"
      aria-labelledby="home-tab0"
    >
      <section className="light">
        <div className="container py-2">
        {reservationsclient.map(reservationclient => <Reservation {...reservationclient} />)}
        </div>
      </section>
    </div>
  );
};

const OrdersList = () => {
  return (
    <div className="tab-pane fade" id="profile0" role="tabpanel" aria-labelledby="profile-tab0">
  <section className="light">
    <div className="container py-2">
    {reservationshost.map(reservationhost => <Reservation {...reservationhost} />)}
    </div>
  </section>
</div>
);
};


export default ReservationsPage;
